import React from "react";
import { makeStyles, Button, TextField } from "@material-ui/core";
import Autocomplete from "@material-ui/lab/Autocomplete";
// import SendIcon from '@material-ui/icons/Send';
import SearchSharpIcon from "@material-ui/icons/SearchSharp";

function SearchTable(props) {
  const classes = useStyles();
  const vehicle = [{ name: "Xe máy" }, { name: "Ô tô" }];
  return (
    <div className={classes.search}>
      <div className={classes.searchText}>
        <TextField
          fullWidth
          size="small"
          variant="outlined"
          label="Nhập biển số"
          placeholder="Nhập biển số vi phạm"
          className={classes.bodertext}
        />
        <Button
          variant="outlined"
          color="primary"
          className={classes.infotitlepopup}
        >
          <SearchSharpIcon className={classes.icon} />
        </Button>
      </div>
      <div className={classes.searchauto}>
        <Autocomplete
          id="size-small-outlined"
          size="small"
          options={vehicle}
          className={classes.textinput}
          getOptionLabel={(option) => option.name}
          renderInput={(params) => (
            <TextField
              className={classes.textinput}
              {...params}
              variant="outlined"
              label="Loại phương tiện"
              placeholder="Favorites"
            />
          )}
        />
        <Autocomplete
          id="size-small-outlined"
          size="small"
          className={classes.textinputnoparking}
          options={vehicle}
          getOptionLabel={(option) => option.name}
          renderInput={(params) => (
            <TextField
              className={classes.textinput}
              {...params}
              variant="outlined"
              label="Loại phương tiện"
              placeholder="Favorites"
            />
          )}
        />
        <Button variant="contained" color="primary" className={classes.button}>
          Tìm kiếm
        </Button>
      </div>
    </div>
  );
}

export default SearchTable;

const useStyles = makeStyles((theme) => ({
  search: {
    // display: "flex",
    padding: 20,
    background: "#e8dbdb1c",
  },
  searchauto: {
    width: "100%",
    display: "flex",
    paddingTop: 15,
  },
  searchText: {
    width: "100%",
    display: "flex",
  },
  button: {
    width: "20%",
    marginLeft: 10,
  },
  textinput: {
    width: "100%",
  },
  textinputnoparking: {
    width: "100%",
    marginLeft: 10,
  },
  bodertext:{
    borderRadius:'4px 0 0 4px'
  },
  infotitlepopup:{
    borderRadius:'4px 0 0 4px'
  }

}));
